webpackJsonp([0x816f021047d7],{7577:function(t,e){t.exports={data:{post:{html:'<p>Since the <a href="http://www.papascott.de/archives/2006/02/03/mabber-me/#comments">Number 1 question</a> I get lately is whether I have any Mabber invitations, it\'s good news that as of now <a href="http://blog.mabber.com/eintrag.php?id=31" title="Open Registration [mabber Blog]">registration for Mabber is open</a>. Come <a href="http://invite.mabber.com/">crash</a> the instant messaging party, no invitation is needed.</p>\n<p>In the spirit of <a href="http://www.joelonsoftware.com/articles/fog0000000012.html" title="What is the Work of Dogs in this Country? - Joel on Software">dogfood</a> I\'ve been using Mabber daily since we starting testing. Not only does it work well, but if you add a little water it makes a very tasty <a href="http://www.gravytraindog.com/">gravy</a>.</p>',fields:{title:"Open Mabber",date:"12 Apr 2006",url:"https://papascott.de/2006-04-12-open-mabber/"}}},pathContext:{slug:"/2006-04-12-open-mabber/",prev:{fields:{title:"I'm trying to think...",date:"11 Apr 2006",slug:"/2006-04-11-im-trying-to-think/"}},next:{fields:{title:"Do Mention The War",date:"14 Apr 2006",slug:"/2006-04-14-do-mention-the-war/"}}}}}});
